import ReactQuill from 'react-quill';
import 'react-quill/dist/quill.snow.css';

export default function Editor({ value, onChange, modules, formats }) {
    return (
        <ReactQuill 
            value={value} 
            onChange={onChange} 
            modules={modules} 
            formats={formats} 
        />
    );
}
